const root = ReactDOM.createRoot(document.getElementById("app"));

const textLinks = ["HOME", "ABOUT", "GEAR"];

const ButtonsClick = ({ links }) => {
  return links.map((eachButton, index) => {
    return (
      <span key={index}>
        <a href="">{eachButton}</a>
      </span>
    );
  });
};

const AboutPage = () => {
  return (
    <>
      <h1>This is the baout page</h1>
    </>
  );
};

const Header = () => {
  return (
    <header>
      <h1>CHON ALBUMS</h1>
      <img
        className="chonLogo"
        src="https://d1h6olfj08dopz.cloudfront.net/images/41392/Chon_Logo_NavBar_Grow.png"
        alt=""
      />

      <nav className="wholenav">
        <Link>Hello</Link>

      </nav>
    </header>
  );
};

//compenet is a function that returns HTML template
const Main = () => {
  return (
    <main>
      <Header /> 
    </main>
  );
};

root.render(<Main />);
